  };

  return (
    <div className='flex flex-col w-64 h-64 border-black border-solid border-2 border-indigo-600 rounded-md justify-center items-center m-5 z-10'>
      <div className='w-62 h-62 bg-black opacity-25 z-0 absolute'></div>
